import React from 'react';
import Calendar from "@ericz1803/react-google-calendar";
import './googlecalendar.css'
import StudentHeading from '/Applications/XAMPP/xamppfiles/htdocs/planner/client/src/components/common/heading/studentheading/StudentHeading.jsx'
import Footer from 'client/src/components/common/footer/FooterFeed.jsx'

const API_KEY = "AIzaSyDA1Dp9WDbt8zN8GdAJbGyJKr-6NrPRy5A";
let calendars = [
    {calendarID: "09opmkrjova8h5k5k46fedmo88@group.calendar.google.com"},
];

let styles = {
    calendar: {
        borderWidth: "3px",
    },
    today: css`
    color: rgb(101,157,169);
    border: 2px solid rgb(101,157,169);
    `,
};

const language = "ES";

class Example extends React.Component {
    render() {
      return (
        <div>
          <Calendar
            apiKey={API_KEY}
            calendars={calendars}
            styles={styles}
            language={language}
          />
        </div>
      );
    }
  }

  export default function GoogleCalendar() {
    return (
      <div>
        <StudentHeading/>
        <div className='App'>
        <iframe src="https://calendar.google.com/calendar/embed?src=0f7a0f250b9c2163405f2c0dde2f40f020bcbee9ab3b785bfc1d410ab5d55017%40group.calendar.google.com&ctz=Asia%2FKolkata" style={{border: 0}} width="800" height="600" frameborder="0"></iframe>
        </div>
        <Footer></Footer>
      </div>
    );
  }
